import React from 'react';
import GridItem from '../GridItem';
import { itemArray } from './Data';
import { GridRowContainer } from './GridRowElements';

const GridRow = () => {
    return (
        <>
            <GridRowContainer>
                {itemArray.map((value, index) => {
                    <GridItem {...value} />
                })}
            </GridRowContainer>
        </>
    )
}

export default GridRow;
